    [],nt"revision_timestamp": "2016-07-27T22:57:03.166521",nt"name": "annual-marsh-and-water-management-program-back-bay-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Marsh and water management activities have
    been conducted for nearly thirty years at Back Bay NWR. Annual programs were submitted
    for many years. In the early 1970's the management effort was de-emphasized due
    to the shift to administration of the Motor Vehicle Access Permit Program. In the
    early 1970s when annual programs were non-existent, managers apparently carried
    out water level manipulations and management activities based on the memories and
    knowledge of the staff (maintenance). In 1985 an annual program was prepared which
    basically outlined the current management regime. The 1985 program was generally
    followed during 1986 - 1988. During that time, slight changes in the management
    effort occurred. The reasoning for the changes was to provide managers with information
    from which they could improve the program. Based on this experience and a renewed
    desire to improve marsh and water management efforts at Back Bay NWR, the Marsh
    and Water Management Plan was totally revised during FY 88. This program is the
    first annual program proposed within the framework of the new plan.",nt"license_title":
